import styled from "styled-components";

const Title = styled.div`
  width: 100%;
  padding: 50px 100px;
`;
const FormWrap = styled.div`
  width: 100%;
  padding: 50px 100px;
`;

const WritingPage = () => {
  return (
    <>
      <Title>커뮤니티 › 게시글 작성</Title>
      <FormWrap>
        <form>
          <div>
            <label>제목</label>
            <input type="text" />
          </div>
          <div>
            <label>게시글 내용</label>
            <textarea></textarea>
          </div>
          <input type="submit" value="작성 완료" />
        </form>
      </FormWrap>
    </>
  );
};

export default WritingPage;
